import React from 'react'
import { useNavigate } from 'react-router'

const Protected = (props) => {
const navigate = useNavigate()
    const {Component} = props
    const isLogin = localStorage.getItem("userInfo")
    if(!isLogin){
        navigate("/")
    }
  return (
    <>
    <Component/>
    </>
  )
}

export default Protected
